import React from 'react';
import './Search-sectie.css';

const SearchSection = () => {
    return (
        <section className="search-section">
            <div className="filters">
                {[...Array(8)].map((_, index) => (
                    <div key={index} className="filter">
                        <input type="checkbox" id={`filter-${index}`} />
                        <label htmlFor={`filter-${index}`}>Box</label>
                    </div>
                ))}
                <button className="save-button">Filter opslaan</button>
            </div>
            <div className="search-results">
                <h2>Zoek naar jouw partner</h2>
                <div className="results">
                    {[...Array(9)].map((_, index) => (
                        <div key={index} className="result-card">Naam</div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default SearchSection;
